import React from 'react';
import DateTime from './DateTime'
import image from "./task icon.png"

export default function WelcomeBanner({name}) {
    return (
        // <div className="App">
        //     <DateTime/>
        //     <img src={image} height={200} alt={"Handover Task Screen"}/>
        // </div>
        <section>
            <div className="row">
                <h1 className="col-md-10" style={{color: 'lightblue'}}>Hello {name}</h1>
                <div className="col-md-1">
                    <DateTime/>
                </div>
                <div className="col-md-1">
                    <img src={image} height={100} alt={"Handover Task Screen"}/>
                </div>
            </div>
        </section>
    );
}
